import React from 'react'
import "./style.css"

const Restaurent = () => {
  return (
  
    <div className='card-container'>
         <div className='card'>
              <div className='card-body'>
                  <span className='card-number card-circle subtle'>12</span>
             <span className='card-author subtle' style={{}}>Breakfast</span>
                  </div>
         </div>
    </div>
   
  );
};

export default Restaurent
